            sentences.append(f"{subject} first aired on {object_val}.")
        elif predicate == "series":
            sentences.append(f"{subject} is part of the {object_val} series.")
        elif predicate == "child":
            sentences.append(f"{subject}'s child is {object_val}.")
        else:
            sentences.append(f"The {predicate} of {subject} is {object_val}.")

    if not sentences:
        return ""

    combined_sentence = ""
    for i in range(len(sentences)):
        if i == 0:
            combined_sentence += sentences[i]
